import { Link } from "react-router-dom"

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="container">
                <Link to="/">
                    <h1>Ad Rabbit</h1>
                </Link>
            </div>
        </div>
    )
}

export default Nav
